@Component({
  selector: 'app-title',
  templateUrl: './title.component.html',
  styleUrls: ['./title.component.css']
})
export class TitleComponent implements OnInit {

  constructor() { }
  @Input() titulo: string | undefined;
  @Input() subtitulo = 'Desde 2021';
  @Input() iconClass = 'fa fa-user';
  ngOnInit() {
  }

}
